webpackJsonp([0x81b8806e4260],{514:function(e,t){e.exports={pathContext:{group:[{node:{fields:{slug:"/54-youtube-screencasts/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/641013810&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>Сегодня у меня небольшое объявление: у подкаста уже давно есть одноимённый YouTube канал.</p>\n<p>Но только этом году я попробовал записывать полноценные скринкасты: видео где показывается реализация какого-то алгоритма на JavaScript. Выбрал не самые простые темы, но интересные (по крайней мере мне). </p>\n<p>Что самое главное, постарался рассказать подробно и понятно, разбивая задачу на отдельные шаги, комментируя принимаемые решения, отвечая на собственные вопросы по ходу. Мне кажется, получилось не плохо, буду продолжать ещё.</p>\n<p>Подписывайтесь: <a href="https://www.youtube.com/channel/UCtcMCp5GwNdQuloP4v5slfw">https://www.youtube.com/channel/UCtcMCp5GwNdQuloP4v5slfw</a></p>',excerpt:"Сегодня у меня небольшое объявление: у подкаста уже давно есть одноимённый YouTube канал. Но только этом году я попробовал записывать…",frontmatter:{title:"Скринасты Пятиминутки React на YouTube",date:"June 23, 2019",featuredImage:null}}},{node:{fields:{slug:"/screeencast_async_await_to_generators/"},html:'<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 56.25%; position: relative; height: 0; overflow: hidden;margin-bottom: 1.0725rem"\n          >\n            <iframe src="https://www.youtube.com/embed/czgxE_UQnDQ" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          "></iframe>\n          </div>\n          </div>\n<p>В этом скринкасте я хочу повнимательнее посмотреть на работу async/await.\nПопробуем вручную транспилировать async/await в генераторы, посмотрим как это делают Babel и TypeScript.</p>\n<p><a href="https://bit.ly/2L0RtMf">https://bit.ly/2L0RtMf</a> - TypeScript Playground\n<a href="https://bit.ly/2RmELsu">https://bit.ly/2RmELsu</a> - Babel Playground</p>',excerpt:"В этом скринкасте я хочу повнимательнее посмотреть на работу async/await.\nПопробуем вручную транспилировать async/await в генераторы…",frontmatter:{title:"Траспиляция из async/await в генераторы",date:"June 18, 2019",featuredImage:null}}},{node:{fields:{slug:"/screeencast_for_loops_are_complicated/"},html:'<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 56.25%; position: relative; height: 0; overflow: hidden;margin-bottom: 1.0725rem"\n          >\n            <iframe src="https://www.youtube.com/embed/gAPh2W8qcUY" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          "></iframe>\n          </div>\n          </div>\n<p>На днях я смотрел занятное видео с погружением в цикл for: <a href="https://youtu.be/Nzokr6Boeaw">https://youtu.be/Nzokr6Boeaw</a></p>\n<p>Оно побудило записать меня этот скринкаст, чтобы своими словами раскрыт тему областей видимости переменных при использовании циклов.</p>',excerpt:"На днях я смотрел занятное видео с погружением в цикл for:  https://youtu.be/Nzokr6Boeaw Оно побудило записать меня этот скринкаст, чтобы…",frontmatter:{title:"JavaScript for-loops are… complicated",date:"June 17, 2019",featuredImage:null}}},{node:{fields:{slug:"/53-msk-vuejs-meetup/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/633139671&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>18 июля 2019 на площадке Voximplant (Москва, ул. Мытная 66) пройдёт MSK VUE.JS MEETUP!</p>\n<p>В этом выпуске Игорь Шеко рассказывает про сам митап и про Vue.js в компании Voximplant.</p>\n<ul>\n<li><a href="https://voximplant.timepad.ru/event/986750/">https://voximplant.timepad.ru/event/986750/</a></li>\n<li><a href="https://soundcloud.com/frontend-weekend/fw-65">https://soundcloud.com/frontend-weekend/fw-65</a> - подкаст Frontend Weekend с участием Игоря Шеко</li>\n</ul>',excerpt:"18 июля 2019 на площадке Voximplant (Москва, ул. Мытная 66) пройдёт MSK VUE.JS MEETUP! В этом выпуске Игорь Шеко рассказывает про сам митап…",frontmatter:{title:"MSK VUE.JS MEETUP",date:"June 7, 2019",featuredImage:null}}},{node:{fields:{slug:"/52-inside-typescript-with-anders-hejlsberg/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/632085261&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>На днях смотрел видео-интервью записанное на конференции Microsoft Build 2019: Inside TypeScript with Anders Hejlsberg.</p>\n<p>Интересные вопросы, очень живая атмосфера, делаю краткий пересказ.</p>\n<ul>\n<li><a href="https://www.youtube.com/watch?v=tXK50czRbdA">https://www.youtube.com/watch?v=tXK50czRbdA</a></li>\n</ul>',excerpt:"На днях смотрел видео-интервью записанное на конференции Microsoft Build 2019: Inside TypeScript with Anders Hejlsberg. Интересные вопросы…",frontmatter:{title:"Inside TypeScript with Anders Hejlsberg",date:"June 5, 2019",featuredImage:null}}}],pathPrefix:"",first:!0,last:!1,index:1,pageCount:12,additionalContext:{}}}}});
